// for now if you want to test any component you created test from this file

import { AppBar, Container, Typography } from '@mui/material';
import './App.css';
import HeaderAppBar from './components/HeaderAppBar';
import { AuthContextProvider } from './components/contexts/AuthContext';
import Recommender from './components/recommendator/Recommender';
import SavedStocksTableView from './components/saved_stocks/SavedStocksTableView';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import Home from './components/home/Home'


function App() {
  // const stock = {
  //   id: '1234',
  //   symbol: 'APOLO',
  //   companyName: 'Apollo Hospital',
  //   bsePrice: 123.5,
  //   nsePrice: 123.4,
  //   timeStamp: new Date().toISOString(),
  //   profit: 0.1
  // }
  return (
    <BrowserRouter>
      <AuthContextProvider>
        <div className="App">
          <div className='header'>
            <HeaderAppBar/>
          </div>

          <Routes>
            <Route
            path='/'
            element={<Home/>}/>
          </Routes>

          <div>
            {/* <Recommender/> */}
            {/* <SavedStockCard stock = {stock}/> */}
            <SavedStocksTableView />
          </div>


        </div>
      </AuthContextProvider>
    </BrowserRouter>

  );
}

export default App;
